import React, { useCallback, useEffect, useState } from "react";
import styled from "styled-components";

function Calender({
  calender,
  setCalender,
  setSelectedDate,
  data,
  selectedDate,
  finishedDay,
  setFinishedDays,
  getFormInfo,
}) {
  const DAYS = ["Mon", "Tue", "Wen", "Thu", "Fri", "Sat", "Sun"];

  const dayLists = DAYS.map((item, i) => {
    return (
      <li className="day" key={i}>
        {item}
      </li>
    );
  });

  useEffect(() => {
    async function getDone() {
      const response = await fetch("http://localhost:3000/timedata");
      const result = await response.json();
      const done = result.map((item) => {
        if (item.date.includes(calender)) return item.date.split(".")[2];
      });
      setFinishedDays(done);
    }
    getDone();
  }, [data, calender]);

  const dateClickHandler = (date) => {
    if (selectedDate === date) return "selected";
    if (finishedDay.includes(String(date))) {
      return "doneDate";
    } else {
      return "date";
    }
  };

  // 월별에 따른 달력 데이터 불러오기
  let dateLists = Array(37)
    .fill("")
    .map((_, idx) => {
      const DATE = new Date(calender);
      const startDay = DATE.getDay() !== 0 ? DATE.getDay() : 7;
      const startMonth = DATE.getMonth() + 1;
      const thirtyMonth = [4, 6, 9, 11];
      const date = idx + 2 - startDay;

      if (startDay - 1 > idx) return <li></li>;
      if (thirtyMonth.includes(startMonth) && date > 30) return <li></li>;
      if (startMonth === 2 && DATE.getFullYear() % 4 === 0 && date > 29) {
        return <li></li>;
      } else {
        if (startMonth === 2 && DATE.getFullYear() % 4 !== 0 && date > 28)
          return <li></li>;
      }
      if (date > 31) return <li></li>;
      return (
        <li
          key={date}
          className={dateClickHandler(date)}
          onClick={() => {
            setSelectedDate(date);
            getFormInfo();
            // 바인딩 함수 추가
          }}
        >
          {date}
        </li>
      );
    });

  // 캘린더 이전 이동버튼 핸들러
  const prevHandler = () => {
    setCalender((current) => {
      let [year, month] = current.split(".");

      if (month === "1") {
        month = "12";
        year = year - 1;
        setCalender(`${year}.${month}`);
        setSelectedDate(1);
      } else {
        setCalender(`${year}.${month - 1}`);
        setSelectedDate(1);
      }
    });
  };
  // 캘린더 다음 이동버튼 핸들러
  const nextHandler = () => {
    setCalender((current) => {
      let [year, month] = current.split(".");

      if (month === "12") {
        month = 1;
        year = Number(year) + 1;
        setCalender(`${year}.${Number(month)}`);
        setSelectedDate(1);
      } else {
        setCalender(`${year}.${Number(month) + 1}`);
        setSelectedDate(1);
      }
    });
  };

  return (
    <Container>
      <div className="header">
        <li className="move-Btn" onClick={prevHandler}>
          <i class="fas fa-chevron-left"></i>
        </li>
        <li className="yearAndMonth">{calender}</li>
        <li className="move-Btn" onClick={nextHandler}>
          <i class="fas fa-chevron-right"></i>
        </li>
      </div>
      <div className="days">{dayLists}</div>
      <div className="dates">{dateLists}</div>
    </Container>
  );
}

const Container = styled.div`
  display: flex;
  flex-direction: column;
  width: 40rem;
  margin: 2rem;
  border: 1px solid #ececec;

  .move-Btn {
    cursor: pointer;
  }

  .yearAndMonth {
    font-size: 1.5rem;
  }

  .header {
    display: flex;
    justify-content: space-around;
    padding: 1rem;
    align-items: center;
    margin-bottom: 1rem;
  }

  .days {
    display: grid;
    grid-template-columns: 14% 14% 14% 14% 14% 14% 14%;
    border-bottom: solid 2px #ececec;
    margin-bottom: 1rem;

    .day {
      text-align: center;
    }
  }

  .dates {
    display: grid;
    grid-template-columns: 14% 14% 14% 14% 14% 14% 14%;
    text-align: center;

    .date {
      text-align: center;
      font-size: 1.2rem;
      margin-bottom: 1rem;
      cursor: pointer;
    }

    .doneDate {
      background-color: #35a859a8;
      border-radius: 10%;
      margin-left: 5px;
      text-align: center;
      font-size: 1.2rem;
      margin-bottom: 1rem;
      cursor: pointer;
    }

    .selected {
      background-color: #7e7d7da1;
      border-radius: 10%;
      margin-left: 5px;
      text-align: center;
      font-size: 1.2rem;
      margin-bottom: 1rem;
      cursor: pointer;
    }
  }
`;

export default Calender;
